import React from "react";
import "./styles.css";

export default function App() {
  return <Button color="blue" disable={true} text="knopf lol" />;
}

const MyComponent = (props) => {
  if (props.disable) {
    return <p>This is rendered when the condition is true.</p>;
  } else {
    return <p>This is rendered when the condition is false.</p>;
  }
};

